<div id="ranking"></div>

<script>

        document.getElementById("2019_chart").onclick = function fun(){
            run2019chart();
        }
        document.getElementById("2020_chart").onclick = function fun(){
            run2020chart();
        }

    
    function run2020chart(){

        d3.select("#svg201920").remove();
        var width = 400,
            height = 400,
            barHeight = height / 2 - 40;

        var formatNumber = d3.format("s");

        var color = d3.scale.ordinal()
            .range(["#1e0946","#ffffb3","#53046f","#e85d22","#80b1d3","#f9ce1c","#980043","#fccde5","#045A8D","#bc80bd"]);

        var svg = d3.select('#ranking').append("svg")
        .attr("id", "svg201920")
            .attr("width", width)
            .attr("height", height)
        .append("g")
            .attr("transform", "translate(" + width/2 + "," + height/2 + ")");

        d3.csv("../data/ranking_2020_count.csv", function(error, data) {
            if (data != undefined) {
                data.sort(function(a,b) { return b.value - a.value; });

        var extent = d3.extent(data, function(d) { return d.value; });
        var barScale = d3.scale.linear()
            .domain([0,3])
            .range([0, barHeight]);

        var keys = data.map(function(d,i) { return d.name; });
        var numBars = keys.length;

        var x = d3.scale.linear()
            .domain([0,3])
            .range([0, -barHeight]);

        var xAxis = d3.svg.axis()
            .scale(x).orient("left")
            .ticks(3)
            .tickFormat(formatNumber);
            
        var circles = svg.selectAll("circle")
                .data(x.ticks(3))
                .enter().append("circle")
                .attr("r", function(d) {return barScale(d);})
                .style("fill", "none")
                .style("stroke", "black")
                .style("stroke-dasharray", "2,2")
                .style("stroke-width",".5px");

        var arc20 = d3.svg.arc()
            .startAngle(function(d,i) { return (i * 2 * Math.PI) / numBars; })
            .endAngle(function(d,i) { return ((i + 1) * 2 * Math.PI) / numBars; })
            .innerRadius(0);
        
        var segments = svg.selectAll("path")
                .data(data)
                .enter().append("path")
                .each(function(d) { d.outerRadius = 0; })
                .style("fill", function (d) { return color(d.name); })
                .attr("d", arc20);

        segments.transition().ease("elastic").duration(1000).delay(function(d,i) {return (25-i)*100;})
                .attrTween("d", function(d,index) {
                    var i = d3.interpolate(d.outerRadius, barScale(+d.value));
                    return function(t) { d.outerRadius = i(t); return arc20(d,index); };
                });

        svg.append("circle")
            .attr("r", barHeight)
            .classed("outer", true)
            .style("fill", "none")
            .style("stroke", "black")
            .style("stroke-width","1.5px");

        var lines = svg.selectAll("line")
            .data(keys)
            .enter().append("line")
            .attr("y2", -barHeight - 20)
            .style("stroke", "black")
            .style("stroke-width",".5px")
            .attr("transform", function(d, i) { return "rotate(" + (i * 360 / numBars) + ")"; });

        svg.append("g")
            .attr("class", "x axis")
            .call(xAxis);

        // Labels
        var labelRadius = barHeight * 1.025;

        var labels = svg.append("g")
            .classed("labels", true);

        labels.append("def")
                .append("path")
                .attr("id", "label-path")
                .attr("d", "m0 " + -labelRadius + " a" + labelRadius + " " + labelRadius + " 0 1,1 -0.01 0");

        labels.selectAll("text")
                .data(keys)
            .enter().append("text")
                .style("text-anchor", "middle")
                .style("font-weight","bold")
                .style("fill", function(d, i) {return "#3e3e3e";})
                .append("textPath")
                .attr("xlink:href", "#label-path")
                .attr("startOffset", function(d, i) {return i * 100 / numBars + 50 / numBars + '%';})
                .text(function(d) {return d.toUpperCase(); });
            }

        });
    }

